SELECT  DISTINCT
--dbo.UfnToLocalTime(PH.UtcTimeStamp) AS [Local Time]
CONVERT(VARCHAR, DAY(dbo.UfnToLocalTime(PH.UtcTimeStamp)), 2) + '-' +
    LEFT(UPPER(FORMAT(dbo.UfnToLocalTime(PH.UtcTimeStamp), 'MMM')), 3) + '-' +
    CONVERT(VARCHAR, YEAR(dbo.UfnToLocalTime(PH.UtcTimeStamp))) AS [Date]
,PH.UnitID
,SUBSTRING(POUE.EtiNo, CHARINDEX('E', POUE.EtiNo) + 1, 
    CASE WHEN CHARINDEX('-', POUE.EtiNo) > 0 THEN CHARINDEX('-', POUE.EtiNo) - CHARINDEX('E', POUE.EtiNo) - 1
         ELSE LEN(POUE.EtiNo) - CHARINDEX('E', POUE.EtiNo)
    END) AS [OriginalEti],
    POUE.EtiNo,
    POUE.LotNo
--PH.*,LPOU.*,POUE.*
FROM [gtt].[dbo].[ProcessHistory] PH
FULL JOIN [gtt].[dbo].LinePointsOfUse LPOU ON LPOU.LineCode = PH.LineCode
FULL JOIN [gtt].[dbo].PointOfUseEtis POUE ON LPOU.PointOfUseCode = POUE.PointOfUseCode 
AND POUE.ComponentNo = '41871' 
AND PH.UtcTimeStamp >= POUE.UtcUsageTime 
AND PH.UtcTimeStamp <= POUE.UtcExpirationTime
AND POUE.UtcUsageTime is not null
AND POUE.LotNo IN ('2023-02-28','2109012051','2109302051','2111152051')
WHERE PH.LineCode = 'LA'  
AND PH.ProcessID = 999
--AND POUE.ID is not null
AND SUBSTRING(POUE.EtiNo, CHARINDEX('E', POUE.EtiNo) + 1, 
        CASE WHEN CHARINDEX('-', POUE.EtiNo) > 0 THEN CHARINDEX('-', POUE.EtiNo) - CHARINDEX('E', POUE.EtiNo) - 1
             ELSE LEN(POUE.EtiNo) - CHARINDEX('E', POUE.EtiNo)
        END) IN ('418353','418354','358725','358726','358727','358728','358729','358730','358731','358732','358733','358734','358735','358736','358737','358738','358739')
